import React from 'react';
import Grid from '@material-ui/core/Grid';
import ControlPanel from './ControlPanel';
import GraphDisplay from './GraphDisplay';

function App() {
  return (
    <React.Fragment>
      <Grid 
        container 
        spacing={2}
        direction="column"
      >
        <Grid item xs={12}>
          <GraphDisplay />
        </Grid>
        <Grid item xs={12}>
          <ControlPanel />
        </Grid>
      </Grid>
    </React.Fragment>
  );
}

export default App;
